// ==UserScript==
// @name         ChatGPT Modernized Layout
// @namespace    http://tampermonkey.net/
// @version      1.9
// @description  A modernized version of ChatGPT with a new layout and loader.
// @author       codecool123
// @icon         https://chatgpt.com/favicon.ico
// @match        https://chat.openai.com/*
// @match        https://chatgpt.com/*
// @grant        none
// @run-at       document-start
// ==/UserScript==

(function() {
  'use strict';

  /* --- Minimal loader with fake progress bar --- */
  const ov = Object.assign(document.createElement('div'), { id: 'cgpt-loader' });
  Object.assign(ov.style, {
    position: 'fixed', inset: 0, background: '#202123',
    display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center',
    zIndex: 999999, userSelect: 'none',
  });

  ov.innerHTML = `
    <img
     src="data:image/png;base64,"
     alt="ChatGPT logo"
     style="width:96px; height:96px; animation:rock 2s ease-in-out infinite alternate; border-radius: 50%;"
    >

    <div id="cgpt-bar-wrap" style="width:420px;height:2px;background:#444;margin-top:32px;">
      <div id="cgpt-bar" style="width:0;height:100%;background:white;transition:none;"></div>
    </div>
    <style>
      @keyframes rock { 0%{transform:rotate(-6deg)} 100%{transform:rotate(6deg)} }
    </style>
  `;

  document.documentElement.appendChild(ov);

  const bar = ov.querySelector('#cgpt-bar');
  let startTime = performance.now();

  // Animate the bar smoothly from 0 to 100% over 1 second
  function animate() {
    let now = performance.now();
    let elapsed = now - startTime;
    let progress = Math.min(elapsed / 1000, 1); // 0 to 1 over 1s
    bar.style.width = (progress * 100) + '%';

    if (progress < 1) {
      requestAnimationFrame(animate);
    } else {
      // Fade out loader after progress bar is full
      ov.style.transition = 'opacity 0.5s ease';
      ov.style.opacity = '0';
      setTimeout(() => ov.remove(), 600);
    }
  }
  animate();

  /* --- Header Blur & Collapse --- */
  function initHeader() {
    const blurPixelAmount = 10;
    const tintRGBA = '0, 0, 0, 0.25';
    const cornerRadius = 12;
    let collapsed = false;

    const chevronUp = '<svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M18 15l-6-6-6 6" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/></svg>';
    const chevronDown = '<svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg" style="transform:rotate(180deg)"><path d="M18 15l-6-6-6 6" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/></svg>';

    function styleHeader() {
      const h = document.getElementById('page-header');
      if (!h) return;
      h.style.backdropFilter = `blur(${blurPixelAmount}px)`;
      h.style.backgroundColor = `rgba(${tintRGBA})`;
      h.style.borderBottomLeftRadius = `${cornerRadius}px`;
      h.style.borderBottomRightRadius = `${cornerRadius}px`;
    }

    function makeBtn(id, html) {
      const b = document.createElement('button');
      b.id = id;
      b.innerHTML = html;
      b.className = 'text-token-text-primary hover:bg-token-surface-hover h-9 w-9 flex items-center justify-center rounded-lg';
      b.style.background = 'transparent';
      b.style.border = 'none';
      b.style.cursor = 'pointer';
      return b;
    }

    function buildCollapse() {
      const header = document.getElementById('page-header');
      const dots = document.querySelector('button[data-testid="conversation-options-button"]');
      if (!header || !dots || document.getElementById('collapse-header-btn')) return;
      const c = makeBtn('collapse-header-btn', chevronUp);
      c.onclick = () => {
        collapsed = true;
        header.style.transition = 'transform .4s ease, opacity .4s ease';
        header.style.transform = 'translateY(-100%)';
        header.style.opacity = '0';
        buildUncollapse();
        c.remove();
      };
      dots.parentNode.insertBefore(c, dots.nextSibling);
    }

    function buildUncollapse() {
      if (document.getElementById('uncollapse-btn')) return;
      const u = makeBtn('uncollapse-btn', chevronDown);
      Object.assign(u.style, {
        position: 'fixed',
        top: '12px',
        right: '12px',
        background: 'rgba(255,255,255,.05)',
        border: '1px solid rgba(255,255,255,.1)',
        boxShadow: '0 4px 12px rgba(0,0,0,.2)',
        backdropFilter: 'blur(10px)',
        zIndex: 10000,
      });
      u.onclick = () => {
        const header = document.getElementById('page-header');
        if (header) {
          collapsed = false;
          header.style.transform = 'translateY(0)';
          header.style.opacity = '1';
          buildCollapse();
          u.remove();
        }
      };
      document.body.appendChild(u);
    }

    function refresh() {
      styleHeader();
      collapsed ? buildUncollapse() : buildCollapse();
    }

    const debounced = (() => {
      let t; return () => { clearTimeout(t); t = setTimeout(refresh, 300); };
    })();

    refresh();
    new MutationObserver(debounced).observe(document.body, { childList: true, subtree: true });
  }

  // Wait for header to exist before initializing header stuff
  const waitForHeader = setInterval(() => {
    if (document.getElementById('page-header')) {
      clearInterval(waitForHeader);
      initHeader();
    }
  }, 300);

})();
